import './collection-page.scss';

import React from 'react'

function CollectionPage({ match }) {
    console.log('match: ', match.param.collectionId);
     
    return (
        <div className='collection-page'>
            <h2>Category page</h2>
        </div>
    )
}

export default CollectionPage
